<!DOCTYPE html>
<html>
  <head>
    <title>QRcode</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
    <meta http-equiv="content-type" content="text/html; charset=utf-8"/>
    <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
    <meta name="apple-mobile-web-app-capable" content="yes"/>
    <link href="qrcode/resources/css/jquery-ui-themes.css" type="text/css" rel="stylesheet"/>
    <link href="qrcode/resources/css/axure_rp_page.css" type="text/css" rel="stylesheet"/>
    <link href="qrcode/data/styles.css" type="text/css" rel="stylesheet"/>
    <link href="qrcode/files/home/styles.css" type="text/css" rel="stylesheet"/>
    <script src="qrcode/resources/scripts/jquery-1.7.1.min.js"></script>
    <script src="qrcode/resources/scripts/jquery-ui-1.8.10.custom.min.js"></script>
    <script src="qrcode/resources/scripts/prototypePre.js"></script>
    <script src="qrcode/data/document.js"></script>
    <script src="qrcode/resources/scripts/prototypePost.js"></script>
    <script src="qrcode/files/home/data.js"></script>
    <script type="text/javascript">
      $axure.utils.getTransparentGifPath = function() { return 'qrcode/resources/qrcode/images/transparent.gif'; };
      $axure.utils.getOtherPath = function() { return 'qrcode/resources/Other.html'; };
      $axure.utils.getReloadPath = function() { return 'qrcode/resources/reload.html'; };
    </script>
  </head>
  <body>
    <div id="base" class="">

      <!-- eyeshow (Image) -->
      <div id="u0" class="ax_default image" data-label="eyeshow">
        <img id="u0_img" class="img " src="qrcode/images/home/eyeshow_u0.png"/>
        <!-- Unnamed () -->
        <div id="u1" class="text" style="display:none; visibility: hidden">
          <p><span></span></p>
        </div>
      </div>

      <!-- Unnamed (Image) -->
      <div id="u2" class="ax_default image">
        <img id="u2_img" class="img " src="qrcode/images/home/u2.jpg"/>
        <!-- Unnamed () -->
        <div id="u3" class="text" style="display:none; visibility: hidden">
          <p><span></span></p>
        </div>
      </div>

      <!-- Unnamed (Image) -->
      <div id="u4" class="ax_default image">
        <img id="u4_img" class="img " src="{{ codeurl }}"/>
        <!-- Unnamed () -->
        <div id="u5" class="text" style="display:none; visibility: hidden">
          <p><span></span></p>
        </div>
      </div>
    </div>
  </body>
</html>
